private String nextToken(){
  char currChar=schema.charAt(pos);
  int endPos=pos;
  while (!(Character.isWhitespace(currChar) || currChar == ':' || currChar == ',' || currChar == '<' || currChar == '>')) {
    endPos++;
    if (endPos == end) {
      break;
    }
    currChar=schema.charAt(endPos);
  }
  String token=schema.substring(pos,endPos);
  pos=endPos;
  return token;
}

