    }
 else {
      submap=this.map.tailMap(new RowLockTable.Row(startRow));
    }
  }
 else {
    if (stopRow != null) {
      submap=this.map.headMap(new RowLockTable.Row(stopRow));
    }
 else {
      submap=this.map;
    }
  }
  return new MemoryScanner(submap.entrySet().iterator(),columns,readPointer);
}

